import { ChatEngine } from "react-chat-engine";
import ChatFeed from "./components/ChatFeed";
import "./App.css";


const App = () =>{
    return(
        <ChatEngine 
            height="100vh"
            projectID="9cc84124-72b3-437c-9096-52094018f81d"
            userName="darwin"
            userSecret="1234"
            renderChatFeed={(chatAppProps) => <ChatFeed {...chatAppProps}/>}
        />
    );
}

export default App;
